import React from 'react';
import {useForm, errors} from 'react-hook-form';
import styled from 'styled-components';
import { Button, Form, Input } from 'reactstrap'; 


export default function Login () {

    const {register, handleSubmit} = useForm();

    const onSubmit = (data) => {
        console.log(data);
    }

    return (

        <StyledLogin>
            <Form onSubmit={handleSubmit(onSubmit)}>
                    <Input type="email" name="email" id="email" placeholder="Email" innerRef={register({required: true} )}/>
                    {errors.email && "Email is required"}
                    <Input type="password" name="password" id="password" placeholder="Password" innerRef={register({required: true, minLength: 8})}/>
                    {errors.password && 'Password is required'}
                    <Button color='primary' type='submit'> Submit </Button>
            </Form>
        </StyledLogin>

    );
};

const StyledLogin = styled.div`
display: flex;
padding-top: 1%;
border: 2px blue dashed;
flex-flow: column wrap;
justify-content: center;
align-items: center;
min-width: 50%;

.button-wrapper {
    display: flex;
    justify-content: center;
    align-items: center;
    padding-top: 5%;
    padding-bottom: 5%;
}
`
